import Footer from "./component/footer"
import Home from "./Home"
import Commit from "./Commit"
import './App.css';
import Calendar from 'react-calendar';
import { useState } from 'react';

function App() {
  const [value, onChange] = useState(new Date());

  return (
    <div className="App">
      <Commit/>
      <Footer/>
      <Calendar
        onChange = { onChange }
        value = { value }
      />
    </div>
  );
}

export default App;
